script: |
  super -f text -I q150.spq | sort > q150.out

inputs:
  - name: q150.spq
    data: |
      SELECT * FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT col0 + col1 / - col1 >= col1 * col1 OR - col0 * cor0.col1 BETWEEN NULL AND + col1;
  - name: tab0

outputs:
  - name: q150.out
    data: |
      24	86	33
      35	97	1
      89	91	82
